import React, { useEffect, useState } from "react";

const Events = () => {
  const [error, setError] = useState(false);
  const [isLoading, setIsLoading] = useState(false);
  const [events, setEvents] = useState();
  useEffect(() => {
    setIsLoading(true);
    const fetchEvents = async () => {
      const response = await fetch("localhost/8080/events");
      if (!response.ok) {
        throw new Error("Error fetch event data");
      }
      const fetchedEvent = response.json();
      setEvents(fetchedEvent);
    };
    try {
      fetchEvents();
    } catch (error) {
      console.log(error);
      setError(error);
    }
  }, []);
  return <div></div>;
};

export default Events;
